import React from "react";
import Card from "./Card";

const CardRow = (props) => {
  const { rowEmojis } = props;
  console.log(rowEmojis)
  return (
    <>
      {rowEmojis.map((currentEmoji, index) => {
        return <Card key={"card" + index} currentEmoji={currentEmoji} />;
      })}
    </>
  );
};

export default CardRow;
